import React from "react";

import Layout from "../components/Layout";
import Card from "../components/Card";
import { PopupWidget } from "react-calendly";


function Home() {
  return (
    <Layout>



      <div className="page-head">
        <div className="page-title">Home</div>

     
      </div>

      <Card
      title='card-title'
      imageUrl='https://images.pexels.com/photos/1843752/pexels-photo-1843752.jpeg?auto=compress&cs=tinysrgb&dpr=3&h=750&w=1260'
      body='Slowing down precisely where you want and when you want is elemental to ride fast and with high levels of confidence. This is even more important with Voima and E-bikes in general since average speeds are higher, and thereâ€™s more mass to decelerate. 

      Brake rotors under 200mm should be disqualified from the start. Bigger rotors mean more braking power, as well as better heat management, thanks to the added mass and volume of the bigger rotor. The most powerful brakes are often of the 4-piston variant, but this is not always the case. '
      />

      <PopupWidget
        url="https://calendly.com/aislamchy96/march-availity"
        /*
         * react-calendly uses React's Portal feature (https://reactjs.org/docs/portals.html) to render the popup modal. As a result, you'll need to
         * specify the rootElement property to ensure that the modal is inserted into the correct domNode.
         */
        rootElement={document.getElementById("root")}
        text="Book Your time !"
        textColor="#ffffff"
        color="#00a2ff"
      />

      


      
      
     
    </Layout>
  );
}

export default Home;
